import React from 'react'

function ModerateFeed() {
  return (
    <div>
            <h2>Moderate Feedback</h2>
            <ul>
                <li>Review & Approve Comments</li>
                <li>Delete Inappropriate Reviews</li>
            </ul>
        </div>
  )
}

export default ModerateFeed
